import React from 'react';
import { Button } from '../ButtonElements';
import img from '../Images/female-healthcare.png';
import { 
    BtnWrap,
    Heading,
    Img, 
    ImgWrap, 
    InfoContainer, 
    InfoRow, 
    InfoWrapper,
    Subtitle,
    TextWrapper,
    TopLine,
    Column1,
    Column2,
} from './InfoElements';

const InfoSection = ({
    lightBg, 
    id, 
    imgStart, 
    topline, 
    lightText, 
    headline, 
    darkText, 
    description, 
    buttonLabel,  
    alt,
    primary,
    dark,
    dark2,
}) => {
    return (
        <>
        <InfoContainer lightBg={lightBg} id={id}>
            <InfoWrapper>
                <InfoRow imgStart={imgStart}>
                    <Column1>
                        <TextWrapper>
                            <TopLine>{topline}</TopLine>
                            <Heading lightText={lightText}>{headline}
                            </Heading>
                            <Subtitle darkText={darkText}>{description}
                            </Subtitle>
                            <BtnWrap>
                                <Button to='/login'
                                smooth={true}
                                duration={500}
                                spy={true}
                                exact="true"
                                offset={-80}
                                primary={primary ? 1 : 0}
                                dark={dark ? 1 : 0}
                                dark2={dark2 ? 1 : 0}
                                >{buttonLabel}</Button>
                            </BtnWrap>
                        </TextWrapper>
                    </Column1>
                    <Column2>
                        <ImgWrap>
                        <Img src={img} alt={alt}/>
                        </ImgWrap>
                    </Column2>
                </InfoRow>
            </InfoWrapper>
        </InfoContainer>
        </>
    );
};

export default InfoSection;
